    'How to catch these errors?' => 'Como arranxar estes erros?',
    'If your webhost supports .htaccess files, you can create one in the root directory of PrestaShop and insert the following line inside: "%s".' => 'Se o teu servizo de hospedaxe web soporta arquivos .htaccess, podes crear un no directorio raíz de Prestashop e inserir dentro a seguinte liña: "%s".',
    'A user requesting a page which doesn\'t exist will be redirected to the following page: %s. This module logs access to this page.' => 'A usuaria que solicite unha páxina que non existe será redirixida á seguinte páxina: %s. Este módulo rexistra o acceso a esta páxina.',
    'You must use a .htaccess file to redirect 404 errors to the "404.php" page.' => 'Debes empregar un ficheiro .htaccess para redirixir os erros 404 á páxina "404.php".',
