  'ModulesStatsequipmentAdmin' => 
  array (
    'Browsers and operating systems' => 'Navegadores e sistemas operativos',
    'Adds a tab containing graphs about web browser and operating system usage to the Stats dashboard.' => 'Engade unha sección no panel de Estatísticas con gráficos sobre os navegadores web e os sistemas operativos que se empregan.',
    'Making sure that your website is accessible to as many people as possible' => 'Asegúrate de que o teu sitio web é accesible ao maior número de persoas posible',
