    'Choose the attribute group for this value.' => 'Escolle o grupo de atributos para este valor.',
    'Choose a color with the color picker, or enter an HTML color (e.g. "lightblue", "#CC6600").' => 'Escolle unha cor co selector de cor ou introduce unha cor HTML (ex. "lightblue", "#CC6600").',
    'Upload an image file containing the color texture from your computer.' => 'Sube unha imaxe que conteña a textura dende o teu ordenador.',
    'This will override the HTML color!' => 'Este sobreescribirá a cor HTML!',
    'Save then add another value' => 'Gardar e engadir un novo valor',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Esta é a imaxe principal para a túa categoría, que se ha amosar na páxina da categoría. A descrición da categoría superporase a esta imaxe e aparecerá na súa esquina superior esquerda.',
    'Only letters and the minus (-) character are allowed.' => 'Só son permitidos letras e símbolos guion (-)',
    'Allow customers to upload files using the contact page.' => 'Permitirlle á clientela subir ficheiros empregando a páxina de contacto.',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Por favor, cubre os campos da mensaxe que aparecen por defecto cando respostas unha consulta na páxina de servizo á clientela.',
